import { Component } from 'react';
import { webmapData } from '../../data/webmapData';

export default class webmapList extends Component {
    state = {
        webmap:WebmapData
    }

  render() {
    let {webmap} = this.state;

    return (
        <div className="content">
            <ul><li><a href="#">Accueil de la présentation - Télécharger le CV</a></li></ul>
        </div>
    )
  }
}
